      {loading ? (
        <div>Loading...</div>
      ) : (
        <div>
          <div>
            {part ? (
              <div>
                <div className="tableContainer">
                  <DetailTable part={part} setPart={setPart} />
                </div>
              </div>
            ) : (
              <div>
                <ServicesIndex data={data} />
              </div>
            )}
          </div>
        </div>
      )}
    </>
  );
}

